import React from 'react';

const Services = () => (
  <section id="services" className="py-12 bg-gray-50">
    <h3 className="text-3xl font-bold text-center text-blue-900 mb-8">Our Services</h3>
    <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 px-4">
      {[
        "Income Tax Filing (ITR-1 to ITR-7)",
        "GST Registration & Returns",
        "Balance Sheet & P&L Preparation",
        "15CA/CB Certification",
        "Company Incorporation",
        "Trademark Registration"
      ].map(service => (
        <div key={service} className="bg-white p-6 rounded-xl shadow-md hover:shadow-lg transition">
          <h4 className="text-lg font-semibold text-blue-800">{service}</h4>
        </div>
      ))}
    </div>
  </section>
);
export default Services;
